import React from 'react';
import './App.css';
import styles from './App.module.css'
import CoronaImage from './images/image.png'
import Tabular from './table/tabular';
import { fetchSummary } from './api/fetchApi'
import Summary from './summary/summary';
// import TableData from './table/TableData';

class App extends React.Component {

  state = {
    data: {}
  }

  async componentDidMount() {
    const fetchedData = await fetchSummary()
    this.setState({ data: fetchedData })
    console.log(fetchedData)
  }


  // }
  //  { data: { Arunachal, Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } }

  //     const { data, country } = this.state;
  render() {
    const { data } = this.state;
    return (
      <>
        <div className={styles.container}>
          <img className={styles.image} src={CoronaImage} alt='Corona' />
        </div>
        <br></br>
        <div class="jumbotron">
          <h1 class="display-4">Hello, world!</h1>
          <p class="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
          <hr class="my-4" />
          <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
          <a class="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
        </div>

        <Summary data={data} />
        <div className="container">
          {/* <img style={{ width: '220px', marginTop: '50px', marginBottom: '50px', justifyContent: 'center' }} src={CoronaImage} alt='Corona' /> */}
          <br></br>

          <Tabular />
        </div>
      </>
    );
  }
}

export default App;
